import React from 'react';

const Button = ({ type = "button", onClick, children, className = "", ...props }) => (
  <button
    type={type}
    onClick={onClick}
    className={`custom-btn ${className}`}
    {...props}
  >
    {children}
  </button>
);

export default Button;
